#include <bits/stdc++.h>
using namespace std;

int mult(string s)
{
    while (s.substr(0, 4) == "mul(")
    {
        s = s.substr(1, s.length() - 1);
    }

    stringstream ss(s);
    int x;
    ss >> x;
    int y;
    ss >> y;
    if (s.length() > 4)
    {
        return x * y + mult(s.substr(4, s.length() - 4));
    }
    else
    {
        return x * y;
    }
}

